import React from 'react';
import { View, Text, StyleSheet } from 'react-native';
import { useNavigation, useRoute } from '@react-navigation/native';
import { Ionicons } from 'react-native-vector-icons';

function tPerfilBaba() {
  const navigation = useNavigation();
  const route = useRoute();
  const { usuario } = route.params;

  function voltar() {
    navigation.goBack();
  }

  return (
    <View style={styles.container}>
      <Ionicons name="chevron-back" size={40} color="black" onPress={voltar} />
      <Text style={styles.title}>Detalhes do usuário:</Text>
      <Text>Nome: {usuario.nome}</Text>
      <Text>Email: {usuario.email}</Text>
      <Text>Celular: {usuario.celular}</Text>
      <Text>Descrição: {usuario.descricao}</Text>
      <View style={styles.view3}>
        <Image source={{ uri: usuario.imagem }} style={styles.imgcontainer} />
      </View>    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 16,
  },
});

export default tPerfilBaba;
